      <div class="col-12">
        <div class="w-full">
          <p-panelMenu [model]="menuItems" styleClass="w-full" [style]="{width: '100%'}">
            <ng-template pTemplate="item" let-item>
              <ng-container *ngIf="item.route; else urlRef">
                <a [routerLink]="item.route"
                   class="flex align-items-center cursor-pointer p-button p-component p-button-text px-3 py-2 ayuda-boton-categoria-secundario cfe-boton-lg w-full">
                  <fn-icon
                    [ico]="iconUtil.obtenerIcono('iViewFile')"
                    height="1.6rem"
                  ></fn-icon>
                  <span class="ml-2">{{ item.label }}</span>
                </a>
              </ng-container>

              <ng-template #urlRef>
                <a *ngIf="item.url; else noLink" [href]="item.url"
                   class="flex align-items-center cursor-pointer p-button p-component px-3 py-2 ayuda-boton-categoria-secundario cfe-boton-lg w-full">
                  <fn-icon
                    [ico]="iconUtil.obtenerIcono('iViewFile')"
                    height="1.6rem"
                  ></fn-icon>
                  <span class="ml-2">{{ item.label }}</span>
                </a>
                <ng-template #noLink>
                  <span
                    class="flex align-items-center cursor-pointer p-button p-component px-3 py-2 ayuda-boton-categoria cfe-boton-lg w-full">
                      <span [class]="item.icon"></span>
                      <span class="ml-2 mt-1 mb-1">{{ item.label }}</span>
                      <i *ngIf="item.items" class="pi pi-angle-down ml-auto"></i>
                  </span>
                </ng-template>
              </ng-template>
            </ng-template>
          </p-panelMenu>
        </div>
      </div>
